import React from 'react';
import { motion } from 'framer-motion';

const Contact = () => {
  return (
    <motion.div
      initial={{ scale: 0.5 }}
      animate={{ scale: 1 }}
      exit={{ scale: 0.5 }}
    >
      <h1>Contact</h1>
      <p>Contact us at contact@example.com.</p>
    </motion.div>
  );
};

export default Contact;
